    </ScrollView>
  );
}
export default function App() {
  const [isLogin, setisLogin] = useState(false);

  return (
    <NavigationContainer>

      {isLogin === false &&
        <LoginStackScreen></LoginStackScreen>
      }

      {
        isLogin === true &&
        <Drawer.Navigator initialRouteName="Home">

          <Drawer.Screen name="Details" component={MyTabs} />
      </Drawer.Navigator>
